  false,\n\t\"url\": null,\n\t\"notes\": \"Summary of biological data collected at
  Bear River Migratory Bird Refuge for the year 1992.  Data is summarized in tables,
  charts, graphs and written summaries.  Data relating to biodiversity, threatened
  and endangered species, Christmas Bird Count, swans, coots, ducks, dabbling ducks,
  diving ducks, waterbirds, cormorants, shorebirds, gulls and terns, foxes, and dummy
  nests are all summarized in this report. Raw data for incidental sightings, weekly
  bird use survey, and historic bird use from 1953-1992 is included in this report,
  as well as historic data of the seasonal abundance of bird on the refuge from 1979.
  \ A bird list brochure is attached to this report.\",\n\t\"license_title\": \"License
